import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../components/styles/ListadoFotos.css';


const ListadoFotos = ()=>{

    return(
        <>
         <Row>
             <Col md={4}> lg={3} xs={12}
             </Col>
         </Row>
        </>

    )
}

export default ListadoFotos;
